const ACNLclock={loadCSS:()=>{},init:()=>{ACNLclock.src=document.getElementById("ACNLclock-script").src.replace("/ACNLclock/script.min.js","");let e=document.createElement("link");e.rel="stylesheet",e.type="text/css",e.href=`${ACNLclock.src}/ACNLclock/style.min.css`,document.getElementById("ACNLclock-script").after(e);let t=document.getElementById("ACNLclock");t.innerHTML=`\n\t\t\t<img src="${ACNLclock.src}/ACNLclock/acnl_clock.svg" alt="">\n\t\t\t<div class="date"><div class="month\n\t\t\t">0</div><span>/</span><div class="day">0</div></div>\n\t\t\t<div class="weekday"></div>\n\t\t\t<div class="time"><div class="hour">0</div><span>:</span><div class="minute">00</div></div>\n\t\t\t<div class="ampm"></div>\n\t\t`,ACNLclock.monthbox=t.querySelector(".month"),ACNLclock.daybox=t.querySelector(".day"),ACNLclock.hourbox=t.querySelector(".hour"),ACNLclock.minutebox=t.querySelector(".minute"),weekdaybox=t.querySelector(".weekday"),ACNLclock.ampmbox=t.querySelector(".ampm"),ACNLclock.update()},update:()=>{console.log("Updating clock");let e=new Date;ACNLclock.monthbox.innerHTML=e.getMonth()+1,ACNLclock.daybox.innerHTML=e.getDate(),weekdaybox.innerHTML=ACNLclock.dayNames[e.getDay()];let t=e.getHours();0==t&&(t=12),ACNLclock.hourbox.innerHTML=t>12?t-12:t;let c=e.getMinutes().toString();ACNLclock.minutebox.innerHTML=c.length<2?"0"+c:c,ACNLclock.ampmbox.innerHTML=e.getHours()>=12?"pm":"am"},dayNames:["Su","Mo","Tu","We","Th","Fr","Sa"]};window.addEventListener("load",(()=>{ACNLclock.init();let e=1e3*(60-(new Date).getSeconds());setTimeout((()=>{ACNLclock.update(),setInterval(ACNLclock.update,6e4)}),e)}));